 Double Dominus::atan_1() {
	 Double ans("1"),a1("1"),a1_1("1");
	 lint limit = 1e5;
	 bool sign_h = false;
	 for (lint i = 0,divv=3 ; i < limit; ++i, sign_h =!sign_h, divv+=2) {
		 a1 /= divv;
		 if (sign_h) {
			 ans += a1;
		 }
		 else {
			 ans -= a1;

		 }
		 a1_1 = a1;
	 }
	 return ans*Double("4");
 }
 Double Dominus::pi_16() {
	Double ans("0"), a16("16"), a16_dop("1"), a8("8"), a1("1"), a2("2"), a4("4"), a5("5"), a6("6");
	lint limit = 10;
	Double k("0");
	Double dop8k;
	Double a1_a16_dop, dif, dop;
	for (lint i = 0; i < limit; ++i, k += a1, dop8k += a8, a16_dop = a16_dop * a16) {
		dif = a4 / (dop8k + a1) - a2 / (dop8k + a4) - a1 / (dop8k + a5) - a1 / (dop8k + a6);
		a1_a16_dop = a1 / a16_dop;
		dop = (a1_a16_dop)*dif;
		ans += dop;
	}

	return ans;
}
 Double Dominus::pi_1_div() {
	Double ans("0");
	//Double c("3.4641016151377545870548926830117447338856105076207612561116139589038660338176000741622923735144971513512522828308134060599398901");
	Double c("3.4641016151377545870548926830117447338856105076207612561116139589038660338176000741622923735144971");
	Double a1("1"), a3_3("1"), a3("3"), k("1"), a2("2");
	Double dop;
	lint limit = 10;
	for (lint i = 0; i < limit; ++i, a3_3 = a3_3 * a3, k += a2) {
		dop = (a1 / (a3_3 * k));
		dop *= (lint)(i % 2 == 0 ? 1 : -1);
		ans += dop;
	}
	return ans * c;
}
 Double Dominus::exp(const Double& inp) {
	lint limit = 10;
	Double  b = inp;
	Double ans("1"), dop("0"), a("1"), a1("1"), aa("1");
	for (lint i = 1; i < limit; ++i, a = a * aa, a = a * b) {
		dop = a;
		dop = dop / a;
		ans += dop;
		aa = aa + a1;
	}
	return ans;
}